import Navbar from "./components/Navbar";
import Feed from "./components/Feed";
import RegisterCheck from "./components/RegisterCheck";
import Profile from "./components/Profile";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { useEffect } from "react";
import { useSelector } from 'react-redux';
import api from "./api/axios";



const App = () => {
  const isLoggedIn = useSelector((state) => state.auth.isLoggedIn);
  const clickedProfile = useSelector((state) => state.auth.clickedProfile);
  const userOb = useSelector((state) => state.auth.userOb);

  use

  return (

    <Router>
      <Navbar />
      <Routes>

        <Route
          path="/"
          element={
            isLoggedIn ?
              <Feed userID={userOb._id} userOb={userOb} />
              : <RegisterCheck route='login' />
          }
        />
        <Route path="/login" element={<RegisterCheck route='login' />} />
        <Route path="/myprofile" element={<Profile userProfile={userOb}  />} />
        <Route path="/profile" element={<Profile userProfile={clickedProfile}  />} />

        <Route
          path="/register"
          element={<RegisterCheck route='register' />}
        />
      </Routes>
    </Router>
  );
};

export default App;
